import React from "react";
import Button from "./Button";

const ShortenedLink = ({ link }) => {
  return (
    <div>
      <p>{link}</p>
      <Button action={() => navigator.clipboard.writeText(link)}>Copy</Button>
    </div>
  );
};

export default ShortenedLink;
